import { AntDesign, MaterialIcons } from '@expo/vector-icons';
import React from 'react';
import { Text, View, Image, TouchableOpacity, StyleSheet } from 'react-native';

const YourApp = () => {
  return (
    <View style={styles.container}>
      <View style={styles.productContainer}>
        <Image
          source={{ uri: 'https://example.com/your-image-url.jpg' }} // Replace with your image URL
          style={styles.productImage}
        />
        <View style={styles.productInfo}>
          <Text style={styles.productTitle}>Nguyên hàm tích phân và ứng dụng</Text>
          <Text style={styles.productSubtitle}>Cung cấp bởi Tiki Trading</Text>
          <Text style={styles.productPrice}>141.800 đ</Text>
          <Text style={styles.productOriginalPrice}>141.800 đ</Text>
          <View style={styles.quantityContainer}>
            <TouchableOpacity style={styles.button}>
              <AntDesign name="minus" size={24} color='black' />
            </TouchableOpacity>
            <Text style={styles.quantity}>1</Text>
            <TouchableOpacity style={styles.button}>
              <MaterialIcons name="add" size={24} color='black' />
            </TouchableOpacity>
            <TouchableOpacity style={styles.laterButton}>
              <Text style={styles.laterButtonText}>Mua sau</Text>
            </TouchableOpacity>
          </View>
        </View>
      </View>

      <View style={styles.discountContainer}>
        <Text style={styles.discountText}>Mã giảm giá đã lưu</Text>
        <TouchableOpacity style={styles.viewDiscountButton}>
          <Text style={styles.viewDiscountText}>Xem tại đây</Text>
        </TouchableOpacity>
      </View>

      <View style={styles.actionsContainer}>
        <TouchableOpacity style={styles.discountCodeButton}>
          <View style={styles.discountCodeIndicator}></View>
          <Text style={styles.discountCodeText}>Mã giảm giá</Text>
        </TouchableOpacity>
        <TouchableOpacity style={styles.applyButton}>
          <Text style={styles.applyButtonText}>Áp dụng</Text>
        </TouchableOpacity>
      </View>

      <View style={styles.separator} />

      <View style={styles.giftCardContainer}>
        <Text style={styles.giftCardText}>Bạn có phiếu quà tặng Tiki/Got it/Urbox?</Text>
        <TouchableOpacity style={styles.enterGiftCardButton}>
          <Text style={styles.enterGiftCardText}>Nhập tại đây?</Text>
        </TouchableOpacity>
      </View>

      <View style={styles.separator} />

      <View style={styles.totalContainer}>
        <Text style={styles.totalText}>Tạm tính</Text>
        <Text style={styles.totalPrice}>141.800 đ</Text>
      </View>
    </View>
  );
};

const styles = StyleSheet.create({
  container: {
    flex: 1,
  },
  productContainer: {
    flex: 1,
    flexDirection: 'row',
    margin: 10,
  },
  productImage: {
    height: 166,
    width: 120,
  },
  productInfo: {
    marginLeft: 10,
    flex: 1,
  },
  productTitle: {
    fontWeight: 'bold',
    fontSize: 13,
  },
  productSubtitle: {
    fontWeight: 'bold',
    fontSize: 13,
    marginTop: 10,
  },
  productPrice: {
    fontWeight: '700',
    fontSize: 20,
    color: 'red',
    marginTop: 20,
  },
  productOriginalPrice: {
    fontWeight: '200',
    fontSize: 20,
    marginTop: 20,
    textDecorationLine: 'line-through',
  },
  quantityContainer: {
    flexDirection: 'row',
    marginTop: 30,
    alignItems: 'center',
  },
  button: {
    borderWidth: 1,
    padding: 5,
  },
  quantity: {
    fontWeight: 'bold',
    fontSize: 13,
    marginLeft: 10,
  },
  laterButton: {
    marginLeft: 69,
  },
  laterButtonText: {
    fontSize: 18,
    fontWeight: 'bold',
    color: '#134FEC',
  },
  discountContainer: {
    flexDirection: 'row',
    alignItems: 'center',
    marginLeft: 10,
    marginBottom: 20,
  },
  discountText: {
    fontSize: 18,
    fontWeight: 'bold',
  },
  viewDiscountButton: {
    marginLeft: 20,
  },
  viewDiscountText: {
    fontSize: 18,
    fontWeight: 'bold',
    color: '#134FEC',
  },
  actionsContainer: {
    flexDirection: 'row',
    marginLeft: '5%',
    marginBottom: 20,
  },
  discountCodeButton: {
    width: '50%',
    height: 40,
    borderWidth: 1,
    alignItems: 'center',
    justifyContent: 'center',
    flexDirection: 'row',
  },
  discountCodeIndicator: {
    width: 30,
    height: 15,
    backgroundColor: 'yellow',
    marginLeft: 10,
  },
  discountCodeText: {
    marginLeft: 10,
    fontWeight: 'bold',
    fontSize: 18,
  },
  applyButton: {
    backgroundColor: '#0A5EB7',
    width: '30%',
    height: 40,
    borderWidth: 1,
    marginLeft: 20,
    alignItems: 'center',
    justifyContent: 'center',
  },
  applyButtonText: {
    color: 'white',
    fontWeight: 'bold',
    fontSize: 18,
  },
  separator: {
    width: '100%',
    height: 20,
    backgroundColor: '#cbded5',
  },
  giftCardContainer: {
    flexDirection: 'row',
    alignItems: 'center',
    marginLeft: 10,
    marginBottom: 20,
  },
  giftCardText: {
    fontWeight: 'bold',
    fontSize: 12,
  },
  enterGiftCardButton: {
    marginLeft: 10,
  },
  enterGiftCardText: {
    color: '#134FEC',
    fontWeight: 'bold',
    fontSize: 18,
  },
  totalContainer: {
    flexDirection: 'row',
    alignItems: 'center',
    marginLeft: 10,
    marginBottom: 20,
  },
  totalText: {
    fontWeight: 'bold',
    fontSize: 18,
  },
  totalPrice: {
    fontWeight: 'bold',
    fontSize: 18,
    color: 'red',
    marginLeft: 180,
  },
});

export default YourApp;
